import React from "react";
import "../../styles/Selection.css";
import gorsel from "../../assets/image_3840.webp";
import { useNavigate } from "react-router-dom";

function CustomerSignUp() {
  const navigate = useNavigate();
  const back = () => {
    navigate(-1);
  };
  return (
    <div className="roll-selection">
      <div className="roll-left">
        <h2>Sign Up </h2>
        <form className="login-form">
          <input type="text" placeholder="first_name" />
          <input type="text" placeholder="last_name" />
          <input type="text" placeholder="email" />
          <input type="text" placeholder="Username" />
          <input type="password" placeholder="Password" />
          <button> Login </button>
          <button type="button" onClick={back}>
            Back
          </button>
        </form>
      </div>

      <div className="roll-right">
        <img src={gorsel} alt="Rol-GÃ¶rseli" />
      </div>
    </div>
  );
}

export default CustomerSignUp;
